from measure_similarity import measure_similarity


def connect_similar_state(noise_trajectory):
    """
    trajectory_set = set()
    for x in noise_trajectory:
        for i in range(0, len(x)):
            if tuple(x[i]) not in trajectory_set:
                trajectory_set.add(tuple(x[i]))

    trajectory_lst = []
    for element in noise_trajectory:
        for i in range(0, len(element)):
            trajectory_lst.append(element[i])

    trajectory_dict = dict()
    for x in trajectory_set:
        trajectory_dict[tuple(x)] = 0
    for y in trajectory_lst:
        trajectory_dict[tuple(y)] += 1

    connection = []
    trajectory_set_lst = list(trajectory_set)
    for i in range(0, len(trajectory_set_lst) - 1):
        element = trajectory_set_lst[i]
        for j in range(i + 1, len(trajectory_set_lst)):
            compared_element = trajectory_set_lst[j]
            if measure_similarity(element, compared_element) > 0.7:
                count = trajectory_dict[element] * trajectory_dict[compared_element]
                connection.append([[element, compared_element] for _ in range(count)])

    return connection
    """

    # took out all the elements from the noise trajectory and out them in one list (one dimensional)
    trajectory_lst = []
    for element in noise_trajectory:
        for i in range(0, len(element)):
            trajectory_lst.append(element[i])

    trajectory_set = set()
    for element in trajectory_lst:
        trajectory_set.add(tuple(element))
    print(len(trajectory_set))

    # make connection of elements in the trajectory list according to their similarity each other
    connection = []
    for i in range(0, len(trajectory_lst) - 1):
        compared_element = trajectory_lst[i]
        for j in range(i + 1, len(trajectory_lst)):
            if measure_similarity(compared_element, trajectory_lst[j]) > 0.7:
                con = [tuple(compared_element), tuple(trajectory_lst[j])]
                connection.append(con)

    return connection


